svg.script:
let r_angle = 0;
let y_angle = 0;
let g_angle = 0;
let w_angle = 0;
let arrows_shift = 1;
let animation_id;
let allow_play = true;

let setint;

function $(sel) {
  return document.querySelector(sel);
}

function gw_upd() {
  $("#alarm").setAttribute("class", "invis");
  g_angle = r_angle - y_angle;
  w_angle = Math.sqrt(g_angle);
  $("#gray_arrow").setAttribute("transform", "rotate(" + (g_angle - 150) + " 912.7 871.2)");
  $("#white_arrow").setAttribute("transform", "rotate(" + (w_angle * 5 - 150) + " 1456 674.2)");

  $("#red_label").textContent = "- " + r_angle + " (BAR)";
  $("#yellow_label").textContent = "- " + y_angle + " (BAR)";
  $("#gray_label").textContent = "- " + g_angle + " (BAR)";
  $("#white_label").textContent = "- " + w_angle.toFixed(2) + " (LPD)";

  if (w_angle > 1) {
    if(allow_play) {
      animation_id = requestAnimationFrame(animate);
    }
    allow_play = false;
  } else {
    if(y_angle >= r_angle) {
      $("#alarm").setAttribute("class", "");
    }
    cancelAnimationFrame(animation_id);
    allow_play = true;
  }

  // console.log("r_angle = " + r_angle + "\r\ny_angle = " + y_angle + "\r\ng_angle = " + g_angle + "\r\nw_angle = " + w_angle);
}

function rarr_dwn() {
  if(r_angle > 0 && r_angle > y_angle) {
    r_angle -= 5;
    gw_upd();
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 641.3 424.7)");
  } else {
    $("#alarm").setAttribute("class", "");
  }
}

function rarr_up() {
  if(r_angle < 300) {
    r_angle += 5;
    gw_upd();
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 641.3 424.7)");
  }
}

function yarr_dwn() {
  if(y_angle > 0) {
    y_angle -= 5;
    gw_upd();
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1223.1 424.7)");
  }
}

function yarr_up() {
  if(y_angle < 300 && r_angle > y_angle) {
    y_angle += 5;
    gw_upd();
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1223.1 424.7)");
  } else {
    $("#alarm").setAttribute("class", "");
  }
}

function animate() {
  if(arrows_shift < 120) {
    arrows_shift += w_angle / 2;
    $("#queue").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#queue2").setAttribute("transform", "translate(" + arrows_shift + " 0)");
  } else {
    arrows_shift = 1;
    $("#queue").setAttribute("transform", "translate(" + arrows_shift + " 0)");
    $("#queue2").setAttribute("transform", "translate(" + arrows_shift + " 0)");
  }
  animation_id = requestAnimationFrame(animate);
}

$("#rb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_dwn()}, 200);
}
$("#rb_left").onclick = function() {rarr_dwn()};

$("#rb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_up()}, 200);
}
$("#rb_right").onclick = function() {rarr_up()};

$("#yb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){yarr_dwn()}, 200);
}
$("#yb_left").onclick = function() {yarr_dwn()};

$("#yb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){yarr_up()}, 200);
}
$("#yb_right").onclick = function() {yarr_up()};

window.onmouseup = function() {clearInterval(setint)};

$("#alarm_close").onclick = function() {
  $("#alarm").setAttribute("class", "invis");
};
$("#demonstrate_close").onclick = function() {
  $("#popup_demonstrate").setAttribute("class", "invis");
};
$("#restrictor_close").onclick = function() {
  $("#popup_restrictor").setAttribute("class", "invis");
};
$("#info").onclick = function() {
  if($("#popup_demonstrate").classList.contains("invis") || $("#popup_restrictor").classList.contains("invis")) {
    $("#popup_demonstrate").classList.remove("invis");
    $("#popup_restrictor").classList.remove("invis");
  } else {
    $("#popup_demonstrate").classList.toggle("invis");
    $("#popup_restrictor").classList.toggle("invis");
  }
}

setTimeout(function(){
  $("#popup_demonstrate").setAttribute("class", "");
  $("#popup_restrictor").setAttribute("class", "");
}, 400);
